import { useContext } from "react";
import { LanguageContext } from "../context/LanguageContext";

export default function Home() {
  const { text } = useContext(LanguageContext);

  return (
    <div>
      <h2>{text.welcome}</h2>
      <p>{text.disclaimer}</p>
    </div>
  );
}
